import style from './Landing.module.css';
import dektop from '../../img/deskt.svg';
import icon1 from '../../img/icon1.png';
import icon2 from '../../img/icon2.png';
import icon3 from '../../img/icon3.png';

const Landing = () => {
    return(
        <div className={style.container}>
            <div className={style.pContainer}>
                <h1 className={style.title}>Hi there!... I'm Cesar, I am a Full Stack  Web Developer.</h1>
                <p className='text-xl'>focused on crafting the Tools you are looking for. </p>
                <div className={style.iconBox}> 
                    <img src={icon1} alt="icon1" />
                    <img src={icon2} alt="icon2" />
                    <img src={icon3} alt="icon3" />
                </div>
            </div>
            <div className={style.imgContainer}><img src={dektop} alt="Cesar" /></div>
        </div>
    )
}

export default Landing;
